public class Thing {

	public static void main(String[] args) {
		String res = "";

		System.out.println(str.length());
		for(int i = 0; i < str.length(); i++) {
			char c = str.charAt(i);

			if((c != 'H' && c!='A' && c != 'S')) res += c;
			if(i < (str.length() - 1) && c == 'H' && str.charAt(i + 1) == 'E') res += c;
		}

		System.out.print(res);
	}

	static String str = "";
}
